PKG.app Payload/PurePKG.app\nzip -r PurePKG.tipa Payload\nrm -r Payload\nmkdir -p \"Payload\"\ncp -r ../PurePKG.app Payload\nzip -r PurePKGDemo.ipa Payload\nrm -r Payload\nif [ ! -d \"../../../Build\" ]; then\n    mkdir -p ../../../Build\nfi\ncp PurePKGDemo.ipa ../../../Build/PurePKGDemo.ipa\ncp PurePKG.tipa ../../../Build/PurePKG.tipa\ngen_deb iphoneos-arm64 var/jb/Applications\ngen_deb iphoneos-arm Applications\ngen_deb iphoneos-arm64e Applications\nfi\nif [[ ${BUILT_PRODUCTS_DIR} == *\"appletvos\"* ]]; then\ngen_deb appletvos-arm64 Applications\nfi\nif [[ \"$SWIFT_PLATFORM_TARGET_PREFIX\" == \"macos\" ]]; then\ngen_macos_deb darwin-amd64\ngen_macos_deb darwin-arm64\nfi\n\nif [ ! -d \"../../../Build\" ]; then\n    mkdir -p ../../../Build\nfi\nfor deb_file in ./*.deb; do\n    filename=$(basename \"$deb_file\")\n    version=$(echo \"$filename\" | sed 's/.*_\\(.*\\)_.*/\\1/')\n    new_filename=\"${filename//_$version/}\"\n    cp \"$deb_file\" \"../../../Build/$new_filename\"\ndone\nfi\n\ncp $PROJECT_DIR/Icon.png ${BUILT_PRODUCTS_DIR}/$BundleName/Icon.png\n";
